import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the "Electronics" category card in the categories grid (main home page)
    // Try to find by text in a category card
    const electronicsCategoryCard = await page.waitForSelector(
      "//div[contains(@class,'category-card')][.//h3[contains(text(),'Electronics')]]",
      { timeout: 5000 }
    );

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_click_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_click_electronics.png'));

    // Click the Electronics category card
    await electronicsCategoryCard.click();

    // Wait for the category results header to appear
    // The header should be an h2 with text "Electronics"
    await page.waitForSelector("//h2[contains(text(),'Electronics')]", { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Extract the number of products in the Electronics category
    // The count is in a div with class 'results-count'
    const resultsCountText = await page.$eval('.results-count', el => el.textContent.trim());
    // Try to extract the number from the text, e.g. "3 products"
    const match = resultsCountText.match(/(\d+)/);
    const numProducts = match ? parseInt(match[1], 10) : null;

    // Optionally, extract the titles of the first 3 products
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.slice(0, 3).map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Navigated to Electronics category via category card on home page",
      extractedData: {
        resultsCountText,
        numProducts,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
